 * Responsabilidad: Mostrar enlaces de navegacion y branding.
 */
@Component({
    selector: 'app-navbar',
    templateUrl: './navbar.component.html',
    styleUrls: ['./navbar.component.css']
})
export class NavbarComponent {
    // Logic here
}
<nav>
  <!-- Navbar template content -->
  <h1>Takket-Quieto</h1>
</nav>
